INSERT INTO `info_pages` VALUES (1,1,'Tentang Kami','<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><strong>gee*eight</strong></span>&nbsp; <span id=\"result_box\" lang=\"id\"><span style=\"\" title=\"\">adalah pendiri boudist / komunitas distro butik. </span><span style=\"\" title=\"\">&quot;Boutique&quot; mewakili makna fashion untuk wanita dan distro melambangkan &quot;melakukannya sendiri&quot; masyarakat.</span><br />\r\n	<br />\r\n	<span style=\"\" title=\"\">Bisnis ritel ini dimulai sejak awal 2004. </span><span style=\"\" title=\"\">Seperti slogan &quot;dirancang khusus bagi gadis modis&quot;, Gee * Eight fokus hanya pada kebutuhan gadis itu. </span><span title=\"\">Yup! </span><span style=\"\" title=\"\">ini dibuat hanya untuk kalian di luar sana.</span><br />\r\n	<br />\r\n	<span style=\"\" title=\"\">Untuk mengatasi perubahan permintaan pasar, pada tahun 2008 kita mengubah slogan menjadi cara yang lebih elegan makna &quot;khusus dirancang untuk Anda&quot;. </span><span style=\"\" title=\"\">Kami terus memasok kebutuhan gadis itu dan juga masuk ke lebih eksotis dan glamour matang perempuan. </span><span style=\"\" title=\"\">Kami pastikan bahwa slogan merefleksikan * gee delapan kegiatan kita sehari-hari melalui seleksi kain yang unik dan desain grafis, terbatas dengan berbagai pilihan desain yang kita hasilkan dalam pembuatan kita sendiri.<br />\r\n	<br />\r\n	&nbsp;</span><br />\r\n	<br />\r\n	<span title=\"\">Terima kasih,</span><br />\r\n	<br />\r\n	<span title=\"\">gee * Eight</span></span></p>\r\n','2010-11-09 03:18:10','2010-12-13 08:53:53','About Us','<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><strong>gee*eight</strong></span> is the founder of boudist / boutique distro community. &ldquo;Boutique&rdquo; represents the meaning of fashion for female and distro symbolize the &quot;do it yourself&quot; community.<br />\r\n	<br />\r\n	This retail business started since early 2004. Like the slogan &quot;especially designed for fashionable girls&quot;, Gee*Eight focus only on girl&#39;s needs. Yup! this is made only for you girls out there.<br />\r\n	<br />\r\n	To cope with the changes of market demand, in 2008 we change the slogan into a more elegant way of meaning &quot;especially designed for you&quot;. We continue to supply the needs of girl&rsquo;s and also entering into a more exotic and glamour mature female. We make sure that the slogan reflect on our everyday gee*eight activities through selection of unique fabric and graphic design, limited with wide selection of design that we produce in our own manufacture.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Thanks,</p>\r\n<p>\r\n	gee*eight</p>\r\n'),(2,1,'Aturan','<p>\r\n	<em>SecurityPayPal, yang dimiliki oleh eBay, global adalah sistem pembayaran online. PayPal adalah nyaman, mudah digunakan, dan aman bagi individu dan bisnis untuk mengirim dan menerima uang online untuk barang, jasa, sumbangan amal, dan sebagainya. Ia juga penuh layanan operasi yang menyediakan front-end dan back-end solusi untuk meningkatkan pertumbuhan dan pendapatan bagi pedagang. Keamanan informasi, transaksi, dan uang adalah inti dari bisnis kami dan kami prioritas utama di PayPal.PayPal Anda secara otomatis encrypts informasi rahasia dalam perjalanan dari komputer Anda ke kami dengan menggunakan protokol Secure Socket Layer (SSL) dengan panjang kunci enkripsi 128-bit (tingkat komersial yang tersedia). Sebelum Anda mendaftar atau bahkan masuk ke situs kami, server kami memeriksa bahwa Anda menggunakan browser yang sudah disediakan - satu yang menggunakan SSL 3.0 atau yang lebih tinggi.</em></p>\r\n','2010-11-09 03:18:10','2010-12-08 04:23:42','Privacy Policy','<p>\r\n	PayPal, owned by eBay, is a global online payment system. PayPal is a convenient, easy-to-use, and secure way for individuals and businesses to send and receive money online for goods, services, charitable donations, and so forth. It is also a full-service operation that provides front-end and back-end solutions to increase growth and revenue for merchants. The security of your information, transactions, and money is the core of our business and our top priority at PayPal.PayPal automatically encrypts your confidential information in transit from your computer to ours using the Secure Sockets Layer protocol (SSL) with an encryption key length of 128-bits (the highest level commercially available).Before you even register or log in to our site, our server checks that you are using an approved browser - one that uses SSL 3.0 or higher.</p>\r\n'),(3,1,'Aturan','<p>\r\n	<em>SecurityPayPal, yang dimiliki oleh eBay, global adalah sistem pembayaran online. PayPal adalah nyaman, mudah digunakan, dan aman bagi individu dan bisnis untuk mengirim dan menerima uang online untuk barang, jasa, sumbangan amal, dan sebagainya. Ia juga penuh layanan operasi yang menyediakan front-end dan back-end solusi untuk meningkatkan pertumbuhan dan pendapatan bagi pedagang. Keamanan informasi, transaksi, dan uang adalah inti dari bisnis kami dan kami prioritas utama di PayPal.PayPal Anda secara otomatis encrypts informasi rahasia dalam perjalanan dari komputer Anda ke kami dengan menggunakan protokol Secure Socket Layer (SSL) dengan panjang kunci enkripsi 128-bit (tingkat komersial yang tersedia). Sebelum Anda mendaftar atau bahkan masuk ke situs kami, server kami memeriksa bahwa Anda menggunakan browser yang sudah disediakan - satu yang menggunakan SSL 3.0 atau yang lebih tinggi.</em></p>\r\n','2010-11-09 03:18:10','2010-12-08 04:25:05','Legal Notice','<p>\r\n	PayPal, owned by eBay, is a global online payment system. PayPal is a convenient, easy-to-use, and secure way for individuals and businesses to send and receive money online for goods, services, charitable donations, and so forth. It is also a full-service operation that provides front-end and back-end solutions to increase growth and revenue for merchants. The security of your information, transactions, and money is the core of our business and our top priority at PayPal.PayPal automatically encrypts your confidential information in transit from your computer to ours using the Secure Sockets Layer protocol (SSL) with an encryption key length of 128-bits (the highest level commercially available).Before you even register or log in to our site, our server checks that you are using an approved browser - one that uses SSL 3.0 or higher.</p>\r\n'),(4,1,'Bagaimana cara mengklaim','<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><em>Hanya unmendable cacat merchandises tergantung bertukar dalam waktu 7 hari setelah pengiriman. Silakan email kami dan kembali kepada kami dengan ORIGINAL TAG, utuh dan PBB-dikenakan dalam waktu 7 hari dalam SAME CONDITION karena telah dikirim kepada Anda. Setelah kami telah dikonfirmasi dengan cacat barang, kami akan segera EXCHANGE non-detektif / merchandises benar untuk Anda, atau KREDIT jumlah pembayaran ke account Anda dengan segera digunakan. Pembeli diharuskan untuk menanggung biaya pengiriman barang kembali. Tidak ada klaim yang digunakan pada barang.</em></span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><em>Pesanan yang dikembalikan kepada kami karena unclaimed, tidak lengkap atau salah alamat yang diberikan tidak akan dikembalikan kepada konsumen dan hanya akan kembali pada pelanggan biaya. Selain itu, pesanan yang ditinggalkan oleh kantor pos setempat atau kebiasaan, karena alasan apapun, tidak akan dikembalikan kepada konsumen dan hanya akan kembali pada pelanggan biaya.</em></span></span></p>\r\n','2010-11-09 03:18:10','2010-12-08 04:26:15','How To Claim','<p>\r\n	<span style=\"font-family: Lucida Sans Unicode,Lucida Grande,sans-serif;\"><span style=\"font-size: 14px;\">Only unmendable defective merchandises are subject to exchange within 7 days of delivery. Please email us and returned to us with our ORIGINAL TAG, UNDAMAGED and UN-WORN within 7 days in the SAME CONDITION as it was sent to you. Once we have confirmed with the defective items, we would immediately EXCHANGE non-detective / correct merchandises for you, or CREDIT the payment amount to your account with immediate use. Buyers are required to bear items returning shipping cost. No claims on used goods.</span></span></p>\r\n<p>\r\n	<span style=\"font-family: Lucida Sans Unicode,Lucida Grande,sans-serif;\"><span style=\"font-size: 14px;\">Orders that are returned to us due to unclaimed, incomplete or incorrect address provided will not be returned to the customer and will only be resent at the customers expense. Additionally, orders that are abandoned by your local post office or customs, for whatever reason, will not be returned to the customer and will only be resent at the customers expense.</span></span></p>\r\n'),(5,1,'Cara Berbelanja','<p>\r\n	<strong><u><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah-langkah Berbelanja:</span></span></u></strong></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 1 :&nbsp; Daftar sebagai anggota gee*eight&nbsp;&nbsp; secara gratis.</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 2 :&nbsp; Login sebagai anggota</span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 3 :&nbsp; Pilih produk kesukaan kamu dan menambahkannya ke keranjang belanja Anda.</span></span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 4 : Ketika selesai belanja online Anda, tekan [Checkout]</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 5: Parcel (s) berat dan biaya pengiriman ke tujuan Anda secara otomatis akan dihitung. Massal untuk biaya pengiriman parsel yang tidak segera dihitung, Customer Service Representative kami akan segera menghubungi Anda tentang biaya pengiriman ke tujuan Anda.</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 6: Ikuti pedoman untuk menyelesaikan pembayaran. (Perhatian: Jika Anda selesai pembayaran melalui PayPal, jangan lupa untuk tekan [Kembali ke geeeight.com] dan kembali kepada kami Terima Kasih untuk halaman keranjang belanja Anda kosong, dan konfirmasi pesanan.)</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 7: PDF Performa Faktur dan Faktur Contoh Nilai yang di-download di urutan kedua halaman Riwayat</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 8: Customer Service Representative kami akan menghubungi Anda mengenai saham Segera avaliability dan pengiriman rincian.</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Langkah 9: Pelacakan nomor akan dikirim kepada Anda bila parsel yang diberikan. Anda juga dapat segera melacak status bingkisan, dengan mengklik pelacakan no. Urutan di halaman Informasi.</span></span></p>\r\n','2010-11-09 03:18:10','2010-12-08 04:27:17','How To Shop','<p>\r\n	<strong><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><u><span style=\"font-family: Arial,Helvetica,sans-serif;\">Simple Shopping Steps:</span></u></span></span></strong></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 1: Register as a gee*eight member for free.</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 2: Login as a member</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 3 : Select your favor products from our list and add them onto your shopping cart.</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 4 : When finish your online shopping, press [Checkout]</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 5: Parcel(s) weight and shipping fee to your destination will be automatically calculated. For bulk parcel which shipping cost does not immediately calculated, our Customer Service Representative will contact you soon about shipping fee to your destination.</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 6: Follow the guideline to settle the payment. (Attention: If you finished payment through PayPal, remember to press [Return to geeeight.com] and go back to our Thank You page in order to empty your shopping cart, and confirm the order.)</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 7: PDF Performa Invoice and Invoice in Sample Value are both downloadable at Order History page.</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 8: Our Customer Service Representative will contact you regarding stocks Immediate avaliability and delivery details.</span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">(** As stocks level is changing every Minite, there may have potentially 5% of goods outstocked every hour, our CS will describe to you in detail, and let you decide wheather you would like wait or exchange for another style to enable faster postage. All excess payment/ excess shipping fee/ price difference would be credited to your member account for latter use.)</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Step 9: Tracking number will be sent to you when parcel is delivered. You may also instantly track the parcel status, by clicking the tracking no. at Order Information page.</span></span></span></p>\r\n'),(6,1,'Cara Pembayaran','<p>\r\n	<strong><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Kami menerima pembayaran dari :</span></span></span></strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><em>- Paypal (Tidak ada tambahan biaya untuk Indonesia transaksi pembayaran melalui BANK BCA &amp; BANK MANDIRI.</em></span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><em>3% kurs biaya tambahan untuk non-dihasilkan sistem pembayaran dalam mata uang lainnya.</em></span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><em>- Pembayaran Kartu Kredit (Melalui Paypal) - Bank pembayaran TT (Tidak ada tambahan biaya untuk transaksi pembayaran Indonesia. 3% kurs biaya tambahan untuk pembayaran dalam mata uang lainnya.</em></span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><em>- Western Union (tidak ada tambahan biaya untuk transaksi pembayaran Indonesia. 3% kurs biaya tambahan untuk pembayaran dalam mata uang lainnya</em></span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><em>Kami mohon maaf bahwa kami TIDAK menerima pribadi dan Bisnis Cek. Semua pembayaran harus diserahkan pada hari pembelian. Jika pembayaran belum diterima setelah periode, item Anda mungkin akan dijual ke pelanggan. Harap JANGAN membeli barang gee*eight jika Anda tidak berniat untuk menindaklanjuti dengan pembayaran. Setelah kami menerima pembayaran Anda, kami akan memperbarui status pesanan dari &quot;Menunggu untuk Memproses&quot;.</em></span></span></span></p>\r\n','2010-11-09 03:18:10','2010-12-13 08:53:14','How To Pay','<p>\r\n	<strong><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">We accept payment from :</span></span></span></strong></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">- Paypal (No additional transaction charge for Indonesia payment through BANK BCA &amp; BANK MANDIRI).</span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">3% exchange rate surcharge for non-system-generated payments in other currencies.</span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">- Credit Card Payment (Through Paypal) - Bank TT payment (No additional transaction charge for Indonesia payment. 3% exchange rate surcharge for payments in other currencies.</span></span></span></p>\r\n<p>\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">- Western Union (No additional transaction charge for Indonesia payment. 3% exchange rate surcharge for payments in other currencies.</span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">We are very sorry that we DO NOT accept Personal and Business Checks. All payments must be submitted within the days of purchase. If payment has not been received after that period, your item may possibly be sold to another customers. Please DO NOT purchase my item if you do not intend to follow up with payment. Once we have received your payment, we will update the order status from &quot;Pending to Processing&quot;.</span></span></span></p>\r\n'),(7,1,'Karir','<p>\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>Kirim lamaran anda ke admin@geeeight.com</strong></span></p>\r\n','2010-11-09 03:18:10','2010-12-13 08:54:40','Career','<p>\r\n	<span style=\"color: rgb(0, 0, 205);\"><strong>Send yor email to admin@geeeight.com</strong></span></p>\r\n'),(8,1,'Syarat dan Ketentuan','<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Comic Sans MS,cursive;\"><em>Kami kapal di seluruh dunia. Silakan lihat kami Shipping Rate informasi di sini. Parcel (s) berat dan biaya pengiriman ke tujuan Anda akan secara otomatis dihitung selama Checkout. Berbeda perkapalan menilai produk berdasarkan berat dan tujuan. Untuk item dalam stok, kami akan segera dikirimkan dalam 1 hari kerja setelah menerima pembayaran Anda. Setelah postingan dari item Anda, kami akan memperbarui status pesanan dari &quot;Memproses untuk Terkirim&quot;, dengan email pemberitahuan. Biasanya pesanan Anda akan tiba dalam 3-5 hari kerja. Kami tidak memberikan pada hari libur. Kami menyadari bahwa ada banyak pos biasanya keterlambatan jika ada hari libur di akhir, jadi silahkan ambil ini menjadi pertimbangan!</em></span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Comic Sans MS,cursive;\"><em>Semua pesanan dikirimkan INA dari Indonesia melalui Pos Pelayanan oleh International Air Mail (EMS), Anda akan menerima nomor pelacakan. Anda dapat melacak paket dengan mengunjungi Indonesia Post Mail Pelacakan sistem pelacakan Anda dan memasukkan nomor ke dalam ruang yang disediakan. Atau pilih negara Anda, hubungkan ke mail pelacakan situs negara secara langsung.</em></span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Comic Sans MS,cursive;\"><em>Jika Anda ingin digabungkan kiriman dari 2 terpisah pesanan, beritahukan kami sebelum Anda menempatkan urutan pertama (Anda juga dapat melihat kami menambahkan komentar teks saat check-out pesanan Anda). Setelah ditempatkan di urutan pertama, Anda akan ada 7 hari untuk menggabungkan semua item yang lain. Bila Anda siap untuk checkout, silakan membayar semua item dalam satu gabungan dan pembayaran silahkan DON&#39;T membayar item Anda ke dalam pembayaran terpisah.</em></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Comic Sans MS,cursive;\"><em>Anda dapat dikenakan bea impor, PPN, pajak, dan / atau biaya bea cukai yang mungkin dikenakan oleh pemerintah daerah saat Anda menerima paket. Anda bertanggung jawab untuk membayar biaya tambahan untuk izin bea cukai. Harga berbeda di setiap negara dan oleh apa yang memerintahkan agar kami tidak dapat memberikan perkiraan biaya. Silahkan hubungi kantor pos setempat atau kantor bea cukai untuk menanyakan tentang biaya</em></span></span></p>\r\n','2010-11-09 03:18:10','2010-12-13 09:05:13','Term Condition','<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Courier New,Courier,monospace;\">We ship worldwide. Please see our shipping rate information here. Parcel(s) weight and shipping fee to your destination will be automatically calculated during Checkout. Different shipping rate based on product weight and destination. For items in stock, we will ship immediately in 1 business days upon receiving your payment. After posting out your items, we would update the order status from &quot;Processing to Delivered&quot;, with email notification. Normally your order will arrive within 3-5 business days. We do not deliver on public holidays. We have noticed that there are usually considerable postal delays if there are public holidays at your end, so please take this into consideration!</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Courier New,Courier,monospace;\">All orders are shipped from Indonesia via INA Postal Service by International Air Mail(EMS), you will receive a tracking number. You can track your package by visiting Indonesia Post Mail Tracking system and entering your tracking number into the space provided. Or select your country, connect to the mail tracking website of the country directly.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Courier New,Courier,monospace;\">If you want to combined shipment of 2 seperate orders, please let us know before you place the first order (you may also notice us by adding comment texts while checking out your order). After you have placed the first order, you will have 7 days to combine all of the other items. When you are ready to checkout, please pay all your items in ONE combined payment and please DO NOT pay your items into separate payments.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Courier New,Courier,monospace;\">You may be subject to import duties, VAT, taxes, and/or customs fees which may be imposed by your local government when you receive your package. You are responsible for paying any additional charges for customs clearance. Rates vary by country and by what was ordered so we are not able to supply an estimated cost. Please contact your local post office or customs office to inquire about these charges.</span></span></p>\r\n'),(9,1,'Partnership','<p>\r\n	<span style=\"font-size: small;\"><span style=\"color: rgb(255, 0, 0);\"><strong>gee*eight</strong></span> memberikan kesempatan kepada anda untuk menjadi partner. </span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: small;\">Silahkan hubungi :</span></p>\r\n<p>\r\n	<span style=\"font-size: small;\">email : customer@geeeight.com</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: small;\">Thanks,</span></p>\r\n<p>\r\n	<span style=\"font-size: small;\">gee*eight</span></p>\r\n','2010-11-09 03:18:10','2010-12-08 04:30:19','Partnership','<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><span style=\"color: rgb(255, 0, 0);\"><strong>gee*eight</strong></span> is open to any opportunity for a win - win reason on business &amp; creative aspect. If you want to partner up with gee*eight such a franchise, licensing and etc, you are welcome.</span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Please contact :</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">email : customer@geeeight.com</span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">Thanks,</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: Arial,Helvetica,sans-serif;\">gee*eight</span></span></p>\r\n');
